class Solution:
    def maximumValueSum(self, board: List[List[int]]) -> int:
        m, n = len(board), len(board[0])

        top_3_indices = []
        for row in board:
            top_3_indices.append(sorted(range(n), key=lambda j: row[j])[-3:])

        res = -math.inf
        for i1 in range(m):
            for i2 in range(i1 + 1, m):
                for i3 in range(i2 + 1, m):
                    for j1 in top_3_indices[i1]:
                        for j2 in top_3_indices[i2]:
                            for j3 in top_3_indices[i3]:
                                if len(set((j1, j2, j3))) < 3:
                                    continue
                                cur_res = board[i1][j1] + board[i2][j2] + board[i3][j3]
                                res = max(res, cur_res)
        return res
